CREATE SCHEMA IF NOT EXISTS dataset;

CREATE TABLE IF NOT EXISTS dataset.PH_DOC_Money (
  ph_date DATETIME,
  ph_myMoney numeric(8, 2),
  ph_organizationMoney numeric(8, 2)
);


SELECT
  ph_date AS Date,
  ph_myMoney AS MyMoney,
  ph_organizationMoney AS OrgMoney,
  (ph_myMoney+ph_organizationMoney) AS SUM
FROM `dataset.PH_DOC_Money`;
